script: |
  super -f text -I q10700.spq | sort > q10700.out

inputs:
  - name: q10700.spq
    data: |
      SELECT ALL + col1 * - + col2 * 25 + 9 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE col2 * + + 59 IN ( + - col2 + + - 60 * - col1 );
  - name: tab1

outputs:
  - name: q10700.out
    data: |
